import React from 'react';
import { BrowserRouter as Routes, Route, Link } from 'react-router-dom';
import "../App.css";

const ScreenOne = (props) => {
    console.log(props.nameItem.show)
    return (
        <div className="section_col">
        <Routes>
            <img src={props.nameItem.show.image.original} alt="movies name" />
            <h1 className="nameText">{props.nameItem.show.name}</h1>
            <button className="screen_button"><a to={`/user/${props.nameItem.show.id}`}>Book Details</a></button>
        </Routes>
        </div>
    )
}

export default ScreenOne;
